INSERT INTO `document` VALUES (2,'다음주 금요일 최종발표 . \n월요일때 발표하는 내용 컨텐츠에 대해 컨설턴트님이 알려줄 예정입니다!!\n\n발표시연, UCC 주말에 논의하겠습니다!!','2022-02-13 00:17:27.483000','2차 회의록','83'),(3,'배포','2022-02-15 13:32:04.792000','팀장 회의록','83'),(4,'회의회의','2022-02-15 13:40:06.925000','팀미팅 회의록','84'),(5,'모르고 삭제\n','2022-02-15 17:18:57.805000','1차 회의록','84'),(8,'dshskhkslkg','2022-02-17 20:44:38.113000','dgsdh','88'),(9,'1. 발표시간은 15분이내\nppt발표자료 + 직접시연 해서 15분\n- 기획 배경/필요성\n언급함으로 필요성 어필 - 이 프로젝트가 꼭 필요하다. 라고 니즈 설명 (강조!!!)\n와이 어프로치\n왜 이 서비스를 하게 되었는지\n- 서비스 가치와 창의성 (창의성에 대한 고민, 노력의 흔적 포함)','2022-02-17 20:57:28.396000','마지막 평가','84'),(12,'안녕하세요\n테스트하겠습니다11','2022-02-18 02:27:40.616000','1차 회의록','129'),(14,'왜그래...','2022-02-18 02:36:21.224000','하이','146'),(15,'일시','2022-02-18 04:00:39.900000','팀미팅','140'),(16,'dd','2022-02-18 05:13:49.646000','dd','162'),(19,'사이트 소개 및 사용법\n기술 특이점, 강조점 (실제 사용법과 싸이트를 움직이는 git 활용)\n처음 접하는 사람은 전혀 사이트에 대해 모르기 때문에 온보딩, help페이지(사용자가이드) 있으면 좋음\n사용자 가이드 UIUX에 배경한 기능소개\n메인기능 부터 소개 부각 로그인 같은 거부터 소개하지 말고 전체적으로 추구하는 그림을 설명\n-동영상 보다는 실제 시연을 해주세요\n-기술 스택 및 아키텍처\n-role 및 팀원 소개','2022-02-18 07:17:13.094000','2차 회의록','129'),(23,'마지막 발표 화이팅!!\n대전2반 화이팅!!','2022-02-18 08:38:55.560000','4차 회의록','129');
