INSERT INTO `solution_book` VALUES (1,'말하지 않으면 아무도 모른다.'),(2,'문제를 발생시켰을 때와 똑같은 의식수준으로는 어떤 문제도 해결할 수 없다.'),(3,'일단 웃으며 다시 시작해봅시다.'),(4,'소신껏 이룬 성공이 아니면, 남 보기에 좋아도 스스로 좋다고 못 느끼면, 전혀 성공이 아니다.'),(5,'어떤 이가 열등감 때문에 우물쭈물하고 있는 동안, 다른 이는 실수를 저지르며 점점 우등한 사람이 되어간다.'),(6,'이 세상에 기쁜 일만 있다면 용기도 인내도 배울 수 없을 것이다.'),(7,'작은 일에 거창한 말을 사용하는 습관은 피해라.'),(8,'우리가 하는 일은 바다에 붓는 한 방울의 물보다 하찮은 것이다. 하지만 그 한 방울이 없다면 바다는 그만큼 줄어들 것이다.'),(9,'사실 노동은 즐겁다.'),(10,'화 났을 때는 아무 일도 하지 말라. 하는 일마다 잘 못 될 것이다.'),(11,'스스로 일하여 얻어라.'),(12,'짧은 순간이라도 충실하게 임하여라.'),(13,'열심히 일하다 죽은 사람은 아무도 없다.'),(14,'커피를 그만 마시고, 당장 일을 시작해라. '),(15,'너무 많은 걱정은 시작을 힘들게 한다.'),(16,'당신이 하는 걱정의 99%는 실제로 일어나지 않는다. '),(17,'무능한 사람이 가장 재능있는 척을 한다.'),(18,'사람들이 일에서 행복하기 위해서는 세 가지가 필요하다. 적성에 맞아야 하고, 너무 많이 해서는 안 되며 성취감을 얻을 수 있어야 한다.'),(19,'쉽게 화 내고 싶지 않다면 그런 습관을 키우지 말라. 화를 돋울 만한 일을 하지 말라.'),(20,'단연코 인생이 주는 최고의 상은 할만한 가치가 있는 일에서 온 힘을 다할 기회이다.'),(21,'아무 하는 일 없이 시간을 허비하지 않겠다고 맹세하라. 우리가 항상 뭔가를 한다면 놀라우리만치 많은 일을 해낼 수 있다.'),(22,'지나치게 관대한 법은 지켜지는 일이 드물고 지나치게 엄격한 법은 시행되는 일이 드물다.'),(23,'휴식이 있어야 새로운 일을 할 수 있다.'),(24,'팀원에게 동기를 부여하라.'),(25,'시간이 없다.'),(26,'뭐든지 제대로 하라.'),(27,'건성으로 하지 말고 철저히 하여라.'),(28,'시간관리가 어렵다면, 돈을 써서라도 타이머를 구매해라.'),(29,'기억력이 나쁜 것의 장점은 같은 일을 여러 번, 마치 처음처럼 즐길 수 있다는 것이다.'),(30,'진정한 기쁨은 편안함이나 부, 혹은 인간에 대한 찬양으로부터가 아니라 가치 있는 일을 하는데서 나온다.'),(31,'경험을 현명하게 사용한다면, 어떤 일도 시간 낭비는 아니다.'),(32,'사람들은 당신이 그 일을 얼마나 빨리했는가는 잊어도 얼마나 잘했는지는 기억한다.'),(33,'하면서 배워라.'),(34,'미루게 되면 곱절로 다가온다.'),(35,'중요한 일에 집중할 수 있는 능력이 바로 지능의 가장 결정적인 특징이다.'),(36,'인생에서 저지를 수 있는 가장 큰 실수는 실수할까봐 끊임없이 두려워하는 일이다.'),(37,'일을 즐기면 일의 완성도가 높아진다.'),(38,'쉬운일은 어려운 일처럼, 어려운 일은 쉬운일처럼 해라.'),(39,'중요한 순간에 침묵하지 마라.'),(40,'될대로 되라지!'),(41,'일단 해보자고!'),(42,'당신이 하는 거의 모든 일이 사소하다. 하지만 당신이 그것을 한다는 것은 매우 중요하다.'),(43,'일을 마무리 하지 않고 떠나려 하지 마라.'),(44,'인내심을 가져라.'),(45,'인간은 쉬운 일을 어렵게 만드는 엉뚱한 특성이 있는 듯 하다.'),(46,'무미건조한 단조로움에 할애할 시간은 없다. 일할 시간과 사랑할 시간을 빼고 나면 다른 것을 할 시간은 없다!'),(47,'창의성은 거의 모든 문제를 해결할 수 있다. 독창성으로 습관을 깨는 창의적 행동으로 모든 일을 극복할 수 있다.'),(48,'배움이 없는 자유는 언제나 위험하며 자유가 없는 배움은 언제나 헛된 일입니다.'),(49,'의심하는 것이 유쾌한 일은 아니다, 하지만 확신하는 것은 어리석은 일이다.'),(50,'이미 끝난 일을 말하여 무엇하며 이미 지나간 일을 비난하여 무엇하리.'),(51,'당신이 할 수 있거나 할 수 있다고 꿈꾸는 그 모든 일을 시작하라. 새로운 일을 시작하는 용기 속에 당신의 천재성과 능력, 그리고 기적이 모두 숨어 있다.'),(52,'천재란 자신에게 주어진 일을 하는 재능 있는 사람일 뿐이다.'),(53,'할 일이 아무 것도 없는 것은 즐겁지 않다. 할 일이 많은데 안 하고 있는 것이 즐거운 것이다.'),(54,'최선을 다하고 있다고 말하는 사람은 대게 아무것도 안하는 편이다.'),(55,'인생은 지긋지긋한 일의 반복이다.'),(56,'할 수 없을 것 같은 일을 하라.'),(57,'실패하라. 그리고 다시 도전하라. '),(58,'이번에는 더 잘 해보라.  '),(59,'넘어져 본 적이 없는 사람은 단지 위험을 감수해 본 적이 없는 사람일 뿐이다.'),(60,'이제 당신이 해야할 차례이다.'),(61,'입을 다물고 있는것도 훌륭한 해결책이 될 수 있다.'),(62,'우리가 해야할 일은 끊임없이 호기심을 갖고 새로운 생각을 시험해보고 새로운 인상을 받는 것이다.'),(63,'다른 사람들이 할 수 있거나 할 일을 하지 말고, 다른 이들이 할 수 없고 하지 않을 일들을 하라.'),(64,'일하는 자는 행복한 자요, 한가한 자는 불행한 자다.'),(65,'어떤 일을 하기에 앞서 스스로 그 일에 대한 기대를 가져야 한다.'),(66,'어떤 일을 달성하기로 결심했으면 그 어떤 지겨움과 혐오감도 불사하고 완수하라. 고단한 일을 해낸 데서 오는 자신감은 실로 엄청나다.'),(67,'내 자신의 일은 항상 지겨워 죽겠다. 남의 일이 더 좋다.'),(68,'용기란 두려워하는 일을 하는 것이다. 두렵지 않으면 용기도 있을 수 없다.'),(69,'컴퓨터는 수많은 일들을 더 쉽게 만들어 주지만 그런 일의 대부분은 할 필요가 별로 없는 것들이다.'),(70,'시간은 환상이다. 점심시간은 두 배로 그렇다.'),(71,'미소 짓기 힘든 상황이라도 웃어야한다.'),(72,'일 분 전만큼 먼 시간은 없다.'),(73,'우리가 진정으로 소유하는 것은 시간 뿐이다. 가진 것이 달리 아무 것도 없는 이에게도 시간은 있다.'),(74,'시간을 낭비하지 말라.'),(75,'여가시간을 가지려면 시간을 잘 써라.'),(76,'한줄 코드라도 서로 거들면 낫다.'),(77,'가는 디자인이 좋아야 오는 프로그램이 좋다.'),(78,'두개의 버그는 한번에 잡을 수 없다.'),(79,'오류를 넘으면 또 오류가 있다.'),(80,'에러 무서워서 코딩 못할까?'),(81,'코드는 못짤지라도 타이핑 하는 재주는 있다.'),(82,'소스도 먼저 코딩하는 놈이 낫다.'),(83,'백업을 해라.'),(84,'프로그래밍은 무엇을 알고 있는가에 대한 것이 아니다. 그것은 당신이 무엇을 알아낼 수 있는 가에 대한 것이다.'),(85,'새로운 프로그래밍 언어를 배우는 유일한 방법은 그 언어로 프로그램을 만드는 것이다.'),(86,'컴퓨터는 쓸모가 없다. 그것은 그냥 대답만 할 수 있다.'),(87,'컴퓨터랑 일하는 건 엄청 멋있다.\n누구랑 싸우지도 않고, 모든 것을 대신 기억해주고,\n내 맥주를 뺏어 마시지도 않으니까.'),(88,'낯선 코드는 믿지 않는게 좋아.'),(89,'이게 맞나? 싶으면 아니다.'),(90,'한번 더 생각해보세요.'),(91,'좋은 소프트웨어의 기능이란 복잡한 것을 간단하게 보이도록 만드는 것이다.'),(92,'책 보고 따라 해도 안된다고, 스스로 자책하지 마라.'),(93,'우리는 프로그래머 3대 미덕을 잘 알고 있다.\n– 게으름, 괴팍함, 그리고 자만심.'),(94,'프로그래머의 문제점은 일이 너무 늦어질 때까지,\n뭘하고 있는지 절대 물어볼 수 없다는 점이다.'),(95,'올바로 작동하지 않는다고 걱정하지 마라.\n모든 게 잘 되었다면, 내가 할 일이 없어진다.'),(96,'먼저 문제를 풀고 그 다음에 개발을 하라.'),(97,'“낙관론”은 프로그래머라는 직업 관점에서 위험물이다.\n“피드백”이 해결책이다.'),(98,'사람은 반복문을 쓰고, 신은 재귀함수를 쓴다.'),(99,'훌륭한 코드는 훌륭한 문서보다 낫다.'),(100,'당신이 6개월 이상 한 번도 보지 않은 코드는\n다른 사람이 다시 만드는 게 훨씬 더 나을 수 있다.'),(101,'디버깅은 코드를 새로 만드는 것보다 두 배 더 어렵다.'),(102,'당신의 컴퓨터에서 돌아가는 건 중요하지 않다.\n당신의 컴퓨터로 서비스하는 게 아니기 때문이다.'),(103,'발명될 수 있는 것은 모두 발명되었다.'),(104,'그런데 그게 무엇에 좋나요?'),(105,'우리가 이룬 것만큼, 이루지 못한 것도 자랑스럽습니다.'),(106,' 품질은 양보다 중요합니다.'),(107,'시간이 없습니다.'),(108,'확실한가요?'),(109,'도움을 받으라'),(110,'무리는 하지 않는것이 좋을 것이다. '),(111,'그럴만한 가치가 있다.'),(112,'예기치 않은 일에 당황하지 말도록'),(113,'당신에게 맞는 일이 기다리고 있다.'),(114,'일단 잠시 쉬세요.'),(115,'그것을 왜 하는지 목적을 명확하게 하세요.'),(116,'포기하지 말고, 함께 헤쳐나갈 귀인이 가까이 있습니다.'),(117,'가까이 있는 사람에게 도움을 받으세요.'),(118,'도움을 받아야 합니다.'),(119,'일단 커피 한잔 드세요.'),(120,'생각의 전환이 필요합니다.'),(121,'용기를 가지세요.'),(122,'너무 안된다 싶은것은 포기하는것도 좋습니다.'),(123,'이정도면 되겠지? 는 자기 합리화 입니다.'),(124,'자신과 타협하지 마세요.'),(125,'지금 시간이 부족하다는 것은 어제 당신이 너무 여유로웠기 때문입니다.'),(126,'맞는 방향입니다.'),(127,'뿌연 안갯속을 걸어가지 마라'),(128,'한치 앞도 보이지 않는다면, 잠시 쉬어가세요.');
/*!40000 ALTER TABLE `solution_book` ENABLE KEYS */;
UNLOCK TABLES;

